    s = stdin.split()[1]
    max_len = 0
    count = 0
    stack = []
    for i in range(n):
        if s[i] == '(':
            stack.append(i)
        elif s[i] == ')':
            if stack:
                start = stack.pop()
                if stack:
                    max_len = max(max_len, i - start - 1)
                else:
                    max_len = max(max_len, i - start)
            else:
                stack.append(i)
        elif s[i] == '_':
            if stack:
                start = stack[-1]
                max_len = max(max_len, i - start - 1)
            else:
                max_len = max(max_len, i)
    for i in range(n):
        if s[i] == '(':
            stack.append(i)
        elif s[i] == ')':
            if stack:
                start = stack.pop()
                if stack:
                    count += i - start - 1
            else:
                stack.append(i)
        elif s[i] == '_':
            if stack:
                start = stack[-1]
                count += i - start - 1
            else:
                count += 1
    return f"{max_len} {count}"

