            return 1
        return n * factorial(n-1)
    def permutation(n, r):
        return factorial(n) // factorial(n-r)
    def happiness(p):
        h = 0
        for i in range(n):
            for j in range(i+1, n+1):
                if p[i-1] > p[j-1]:
                    h += permutation(n-i, j-i)
        return h
    ans = 0
    for i in range(1, n+1):
        ans += happiness(list(range(1, n+1)))
        ans %= MOD
    return str(ans)

