def solution(stdin: str) -> str:
    # Parse input
    N, M = map(int, stdin.readline().split())
    keys = []
    for _ in range(M):
        a, b = map(int, stdin.readline().split())
        keys.append((a, b))
    # Create graph
    graph = [[] for _ in range(N+1)]
    for i in range(M):
        for j in range(keys[i][1]):
            graph[keys[i][0]].append(i+1)
    # Bellman-Ford algorithm
    dist = [float('inf')] * (N+1)
    dist[1] = 0
    for _ in range(N):
        for u in range(1, N+1):
            for v in graph[u]:
                if dist[u]!= float('inf') and dist[u] + keys[v-1][0] < dist[v]:
                    dist[v] = dist[u] + keys[v-1][0]
    # Check if all boxes are unlocked
    if any(dist[i] == float('inf') for i in range(2, N+1)):
        return '-1'
    # Calculate minimum cost
    return str(sum(keys[i-1][0] for i in range(1, M+1) if all(dist[j]!= float('inf') for j in graph[i])))

