def solution(stdin: str) -> str:
    # Parse input
    n = int(stdin.readline().strip())
    graph = [[0] * n for _ in range(n)]
    for i in range(n):
        row = list(map(int, stdin.readline().strip().split()))
        for j in range(n):
            graph[i][j] = row[j]
            graph[j][i] = row[j]

    # Initialize distances and visited arrays
    distances = [float('inf')] * n
    distances[0] = 0
    visited = [False] * n
    visited[0] = True

    # Dijkstra's algorithm
    for i in range(n):
        min_distance = float('inf')
        min_index = -1
        for j in range(n):
            if not visited[j] and distances[j] < min_distance:
                min_distance = distances[j]
                min_index = j
        if min_index == -1:
            break
        visited[min_index] = True
        for j in range(n):
            if not visited[j] and graph[min_index][j]!= 0:
                new_distance = distances[min_index] + graph[min_index][j]
                if new_distance < distances[j]:
                    distances[j] = new_distance

    # Find maximum distance
    max_distance = 0
    for i in range(n):
        for j in range(i+1, n):
            if graph[i][j]!= 0:
                max_distance = max(max_distance, distances[i] + distances[j] - graph[i][j])

    return str(max_distance)

