    for i in range(n):
        if tree[i][0] == -1:
            root = i
            break
    # find ancestors
    ancestors = [[] for _ in range(n)]
    stack = [root]
    while stack:
        u = stack.pop()
        for v in range(n):
            if tree[v][0] == u:
                ancestors[v].append(u)
                stack.append(v)
    # find non-respecting vertices
    non_respecting = []
    for i in range(1, n):
        if tree[i][1] == 1:
            continue
        if not any(tree[j][1] == 1 for j in ancestors[i]):
            non_respecting.append(i)
    # find smallest non-respecting vertex
    if not non_respecting:
        return '-1'
    v = min(non_respecting)
    # delete vertex v and connect its children with its parent
    parent = tree[v][0]
    for child in range(n):
        if tree[child][0] == v:
            tree[child][0] = parent
    # delete v
    tree[v] = [-1, 0]
    # find order to delete vertices
    order = []
    stack = [root]
    while stack:
        u = stack.pop()
        if tree[u][0]!= -1:
            order.append(u)
            stack.append(tree[u][0])
    return''.join(map(str, order))

