    B = [int(x) for x in stdin.readline().split()]

    # Initialize dp table
    dp = [[0] * N for _ in range(1 << N)]

    # Base case: choose no sardines
    for i in range(N):
        dp[1 << i][i] = 1

    # Fill dp table
    for mask in range(1 << N):
        for i in range(N):
            if not (mask >> i) & 1:
                continue
            for j in range(N):
                if i == j or (mask >> j) & 1:
                    continue
                if A[i] * A[j] + B[i] * B[j] == 0:
                    dp[mask][i] += dp[mask ^ (1 << i)][j]
                    dp[mask][i] %= 1000000007

    # Count number of ways to choose sardines
    count = 0
    for i in range(N):
        count += dp[(1 << N) - 1][i]
        count %= 1000000007

    return str(count)

