def solution(stdin: str) -> str:
    # Parse input
    N, Q = map(int, stdin.readline().split())
    edges = []
    for i in range(N - 1):
        a, b = map(int, stdin.readline().split())
        edges.append((a, b))
    operations = []
    for i in range(Q):
        p, x = map(int, stdin.readline().split())
        operations.append((p, x))

    # Build tree
    tree = [[] for _ in range(N + 1)]
    for a, b in edges:
        tree[a].append(b)
        tree[b].append(a)

    # Perform operations
    for p, x in operations:
        # Find subtree rooted at p
        subtree = [p]
        stack = [p]
        while stack:
            node = stack.pop()
            for child in tree[node]:
                if child not in subtree:
                    subtree.append(child)
                    stack.append(child)

        # Increment counters on subtree
        for node in subtree:
            tree[node][0] += x

    # Print counters
    counters = [0] * (N + 1)
    for node in range(2, N + 1):
        for child in tree[node]:
            counters[node] += counters[child]
    return''.join(map(str, counters[2:]))

