        for j in range(cols):
            if grid[row][j] == str(digit):
                return False

        # check column
        for i in range(rows):
            if grid[i][col] == str(digit):
                return False

        # check region
        for i, j in regions[region_index(row, col, regions)]:
            if grid[i][j] == str(digit):
                return False

        return True

    def region_index(row, col, regions):
        for i, region in enumerate(regions):
            if (row, col) in region:
                return i
        return None

