    for i in range(1, n+1):
        for j in range(1, n+1):
            for x in range(k+1):
                if j > i:
                    dp[x][j] = min(dp[x][j], dp[x][j-1] + costs[j-1][i-j])
                else:
                    dp[x][j] = min(dp[x][j], dp[x-1][j] + costs[j-1][i-j])
    return str(dp[k][n])

def solution(stdin: str) -> str:
    # parse input
    N, M = map(int, stdin.split())
    edges = []
    for i in range(M):
        a, b = map(int, stdin.readline().split())
        edges.append((a, b))

    # create graph
    graph = [[] for _ in range(N+1)]
    for a, b in edges:
        graph[a].append(b)
        graph[b].append(a)

    # DFS to find all paths
    paths = []
    def dfs(node, path, visited, color):
        if node == N:
            paths.append(path)
            return
        for neighbor in graph[node]:
            if neighbor not in visited:
                visited.add(neighbor)
                dfs(neighbor, path + [(node, neighbor, color)], visited, color)
                visited.remove(neighbor)

    # find all paths
    for i in range(1, N+1):
        visited = set()
        dfs(i, [(i, i, None)], visited, None)

    # count color changes in each path
    color_changes = [0] * len(paths)
    for i, path in enumerate(paths):
        prev_color = None
        for a, b, color in path:
            if color!= prev_color:
                color_changes[i] += 1
            prev_color = color

    # return maximum color changes
    return max(color_changes)

def solution(stdin: str) -> str:
    n, s = map(int, stdin.split())
    participants = []
    for i in range(n):
        name, bet = stdin.split()
        participants.append((name, int(bet)))
    participants.sort(key=lambda x: x[1], reverse=True)
    winners = []
    for i in range(n):
        name, bet = participants[i]
        if sum(p[1] for p in participants[:i+1]) == s:
            winners.append(name)
    return str(len(winners)) + '\n' + '\n'.join(winners)
